    <link href='https://api.tiles.mapbox.com/mapbox-gl-js/v2.9.2/mapbox-gl.css' rel='stylesheet' />
</head>
<body>

      <MapContainer>
				<div ref={el => this.mapContainer = el} style={{width:'100%', height:'80vh'}}/>
			</MapContainer>

</body>
    </div>
  )
}

export default MapCard
